export const Dropdown = ()=>{
    return (
        <div>
            <label htmlFor="cars">Choose the max length per page:</label>
            <select name="cars" id="cars">
                <option value='5'>5</option>
                <option value='10'>10</option>
            </select>
        </div>
    )

}
